import React from "react";

const DropDown = () => {
  return (
    <>
      <a
        href="/home"
        className="block transition-color p-2 text-xl   text-blue-950  hover:text-yellow-500 hover:text-2xl"
      >
        Home
      </a>
      <a
        href="/Gaming"
        className="block transition-color p-2 text-xl   text-blue-950  hover:text-yellow-500 hover:text-2xl"
      >
        Gaming
      </a>
      <a
        href="/kitchen"
        className="block transition-color p-2 text-xl  text-blue-950  hover:text-yellow-500 hover:text-2xl"
      >
        Kitchen
      </a>
    </>
  );
};

export default DropDown;
